import React, { useState, useEffect } from 'react';
import axios from 'axios';

const Actions = () => {
  const [actions, setActions] = useState([]);
  const [description, setDescription] = useState('');
  const [date, setDate] = useState('');
  const [userId, setUserId] = useState('');

  useEffect(() => {
    fetchActions();
  }, []);

  const fetchActions = async () => {
    try {
      const response = await axios.get('/Actions_API/actions');
      setActions(response.data);
    } catch (error) {
      console.error('Error fetching actions:', error);
    }
  };

  const handleAddAction = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post('/Actions_API/actions', { description, date, userId });
      setActions([...actions, response.data]);
      setDescription('');
      setDate('');
      setUserId('');
    } catch (error) {
      console.error('Error adding action:', error);
    }
  };

  return (
    <div>
      <h1>Actions</h1>
      <ul>
        {actions.map((action) => (
          <li key={action.id}>{action.description} (User ID: {action.user_id})</li>
        ))}
      </ul>
      <form onSubmit={handleAddAction}>
        <input type="text" placeholder="Description" value={description} onChange={(e) => setDescription(e.target.value)} required />
        <input type="date" value={date} onChange={(e) => setDate(e.target.value)} required />
        <input type="number" placeholder="User ID" value={userId} onChange={(e) => setUserId(e.target.value)} required />
        <button type="submit">Add Action</button>
      </form>
    </div>
  );
};

export default Actions;
